import {
  Card,
  CardContent,
  CardMedia,
  Grid,
  Typography,
} from '@material-ui/core';
import React from 'react';
import { useStyles } from './css/main';
import RankedRest from './common/rankedRest';
import homeSlider from './images/homeSlider.jpg';

export default function Silder() {
  const classes = useStyles();

  return (
    <div className={classes.body}>
      <CardMedia
        image={homeSlider}
        component="img"
        className={classes.homeSlider}
      />

      <Typography>
        <CardContent className={classes.sliderText}>
          <Typography className={classes.sliderTitleText}>
            ברוכים הבאים למִסְעֵדָה
          </Typography>
          <Typography className={classes.sliderSmallTitleText}>
            חיפוש מסעדות לפי עדות
          </Typography>
        </CardContent>
      </Typography>

      <Typography>
        <CardContent className={classes.rankText}>
          <Typography className={classes.rankTitleText}>
            חמש המסעדות המדורגות ביותר:
          </Typography>

          <Grid container>{/* <RankedRest /> */}</Grid>
        </CardContent>
      </Typography>
    </div>
  );
}
